import { BrowserRouter as Router } from 'react-router-dom';
import './App.css';
import AuthProvider from './Components/Auth/AuthProvider';
import Routes from './Routes/Routes';
function App() {
  return (
    <Router>
      <AuthProvider>
      <Routes/>
      </AuthProvider>
    </Router>
  );
}

export default App;
